import React, { useEffect, useState } from "react";
import axios from "../../api/axios";
import SendNotification from "../../Functions/SendNotification";
import { useSelector, useDispatch } from "react-redux";

import {
  SendNotiToUpdateNumber,
  SendNotiToUpdateData,
} from "../../Redux/action";



const AddOrderForm = ({ onEditComplete ,allProducts}) => {
  const dispatch = useDispatch();
  const countofNoti = useSelector((state) => state.NotiCount);

  const [products, setProducts] = useState([{ productId: '', quantity: 1 }]);

  const handleProductChange = (index, productId) => {
    const updatedProducts = [...products];
    updatedProducts[index].productId = productId;
    setProducts(updatedProducts);
  };

  const handleQuantityChange = (index, quantity) => {
    const updatedProducts = [...products];
    updatedProducts[index].quantity = quantity;
    setProducts(updatedProducts);
  };

  const handleAddProduct = () => {
    setProducts([...products, { productId: '', quantity: 1 }]);
  };

  const handleRemoveProduct = index => {
    const updatedProducts = [...products];
    updatedProducts.splice(index, 1);
    setProducts(updatedProducts);
  };

  const handleSubmit = async () => {
    // Send order data to backend API
    try {
      const response = await fetch('your_api_endpoint', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(products),
      });
      const data = await response.json();
      console.log(data);
    } catch (error) {
      console.error('Error:', error);
    }
  };







  // const [formData, setFormData] = useState({
  //   name: "",
  //   quantity: "",
  //   price: "",
  //   description: "",
  //   MinimumNumberAllowedInstock: "",
  // });

  //  const handleChange = (e) => {
  //     const { name, value } = e.target;
  //     setFormData({
  //       ...formData,
  //       [name]: value,
  //     });
  //   };

  // const handleSubmit = async (e) => {
  //   e.preventDefault();
  //   try {
  //     const csrfResponse = await axios.get("/get-csrf-token");
  //     const csrfToken = csrfResponse.data.token;

  //     axios.defaults.headers.common["X-CSRF-TOKEN"] = csrfToken;
  //     console.log(formData);
  //     const response = await axios.post("/orders", formData);
  //     dispatch(SendNotiToUpdateNumber(parseInt(countofNoti) + 1));


  //     onEditComplete();
  //     console.log("Order added successfully");
  //     setFormData({
  //       user_id: "",
  //     });
  //     document.querySelector("#add_order").click();
  //   } catch (error) {
  //     console.error("Error adding product:", error.message);
  //   }
  // };



  return (
    <div id="add_order" className="modal custom-modal fade" role="dialog">
      <div className="modal-dialog modal-dialog-centered" role="document">
        <div className="modal-content">
          <div className="modal-header">
            <h5 className="modal-title">Add Order</h5>
            <button
              type="button"
              className="close"
              data-dismiss="modal"
              aria-label="Close"
            >
              <span aria-hidden="true">Ã—</span>
            </button>
          </div>
          <div className="modal-body">

            {/* <div className="form-group">
                <label>
                Order Name <span className="text-danger">*</span>
                </label>
                <input
                  name="name"
                  className="form-control"
                  type="text"
                  value={formData.name}
                  onChange={handleChange}
                />
              </div> */}

            {products.map((product, index) => (
              <div 
              className="form-group"
              key={index}>
                <select
                  className="col-8"
                  value={product.productId}
                  onChange={e => handleProductChange(index, e.target.value)}
                >
                  <option value="">Select Product</option>
                  {allProducts.map(product => (
                    <option key={product.id} value={product.id}>
                      {product.name}
                    </option>
                  ))}
                </select>
                <input
                className="col-2"
                  type="number"
                  value={product.quantity}
                  onChange={e => handleQuantityChange(index, parseInt(e.target.value))}
                />
                <button className="col-2" onClick={() => handleRemoveProduct(index)}>Remove</button>
              </div>
            ))}



            <div className="submit-section">
              <button
                type="submit"
                name="add_product"
                className="btn btn-primary submit-btn"
                onClick={handleAddProduct}
              >
                Add Product
              </button>
            </div>
            <div className="submit-section">
              <button
                className="btn btn-primary submit-btn"
                onClick={handleSubmit}
              >
                Submit Order
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AddOrderForm;
